THE FIRST KEITH HARING ON THE BLOCKCHAIN 🗽

‼️🚨SOTHEBY’S AUCTION is now open for the first ever Keith Haring 1/1 NFT 🚨‼️

‘Speak on Liberty,’ the collaborative work of art by Keith Haring + 1,000 CityKids has been dihitalized and minted on the Ethereum blockchain and in a historic moment for fine art, technology, and philanthropy, is now available for acquisition with the premier auction house.

Fast facts:

🗽FIRST HARING NFT TO AUCTION
🗽HARINGS ‘MOST SIGNIFICANT WORK’
🗽PROFITS TO BENEFIT CITYKIDS

‘Speak on Liberty #1’ 
Keith Haring + CityKids, 1986
Estimated Value: 60,000-80,000 USD

‼️Auction ends December 21st, 2022‼️

